import React, { Component } from 'react'

class Track extends React.Component
{
    render() {        
        if ( !this.props.data ) {
            return('');
        }

        return (            
            <div>
                <h3>{ this.props.data.name }</h3>        
                <div>
                    { this.props.data.times.map((level)=> 
                        <div>aaa</div>
                    )}    
                </div>
            </div>
        )
    }
}

export default Track;
